  \"2016-03-25T22:34:59.817345\",\n\t\"name\": \"geologic-factors-in-the-prehistoric-establishment-of-organisms-endemic-to-eolian-dunes-nea\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Among geologic topics pertaining to endangered
  inhabitants of Antioch dunes, probably the most important are distribution of eolian
  sand in central California, which would constrain methods of migration; the age
  of the Antioch dunes, which might determine rates of speciation; and climatic change
  since establishment of the dunes, a significant variable for organisms at the limit
  of their geographic range.The Fish and Wildlife Service grant has allowed me to
  explore aspects of each of these topics.  The grant not only underwrote 1000 ft
  og auger drilling at 14 sites near Antioch, it also freed funds within the U.S.
  Geological Survey for closely related drilling at Tulare Lake bed in the southern
  San Joaquin Valley.  The following summaries draw both on previously available data
  and on results of these recent drilling programs.\",\n\t\"license_title\": \"License
